import "./App.css";
import Participants from "./components/Participants";

function App() {
  return (
    <Router>
      <Container>
        <LinkContainer to="/">
          <Navbar.Brand href="/">
            <img className="brand-icon" src={logo} alt="Logo" />{" "}
          </Navbar.Brand>
        </LinkContainer>
      </Container>
      <Routes>
